import { notFlipInclude } from '../';
describe('notFlipInclude', function () {
  it('returns false if array contains item', function () {
    expect(notFlipInclude(['a'], 'a')).toEqual(false);
  });
  it('returns true if array does not contain item', function () {
    expect(notFlipInclude(['a'], 'b')).toEqual(true);
  });
});